		function addEnemies(pos) {
			var num = Math.round(pos / 3);
			var startNum = num - 5;
			var endNum = num + 5;
			var curNum = startNum;
			
			if (eTypes == 0) {
				curClass = Math.floor(Math.random() * 2);
			}
			else if (eTypes == 1) {
				curClass = 0;
			}
			else {
				curClass = 1;
			}
			
			while (curNum <= endNum) {
				var curPos = curNum * 3;
				if (curNum != 0 && !enemyHere(curNum) && Math.abs(curPos - pos) > 2) {
					if (Math.abs(curPos) < 120) {
						var randD = Math.floor(Math.random() * 5);
					}
					else if (Math.abs(curPos) < 220) {
						var randD = Math.floor(Math.random() * 6);
					}
					else if (Math.abs(curPos) < 320) {
						var randD = 1 + Math.floor(Math.random() * 6);
					}
					else if (Math.abs(curPos) < 450) {
						var randD = 3 + Math.floor(Math.random() * 6);
					}
					else if (Math.abs(curPos) < 550) {
						var randD = 6 + Math.floor(Math.random() * 5);
					}
					else {
						var randD = Math.floor(Math.random() * 11);
					}
					
					makeMob(curClass, randD, curPos, curNum);
		
				}
				curNum += 1;
			}
		}
		
		
