		this.addEventListener("tick", move_player.bind(this));
		function move_player() {
			tick++;
			fps2++;
			this.earth.gotoAndStop(Math.floor(((field_move + (Math.abs(Math.round(field_move * 100)))) % 1) * 100));
		
			if (!player) {
				player = new Player();
			}
			
			
			if (!battle) {
				player.posX += player.speed * player.direction / fps * timeMult;
				player.tick = 51 / 120 * player.tickMax;
				if (closestEnemy) {
					closestEnemy.tick = 51 / 120 * closestEnemy.tickMax;
				}
				prevFr1 = 35;
				prevFr2 = 35;
			}
		
			if (!enemyHere(Math.round((player.posX - 15) / 3)) || !enemyHere(Math.round((player.posX + 15) / 3))) {
				addEnemies(player.posX);
			}
		
			if (stage.getChildIndex(closestEnemy) >= stage.getChildIndex(this.the_player) && !battle) {
				stage.addChild(this.the_player);
			}
			
			this.the_player.animation.weapon.type.gotoAndStop(player.weapon.weight + 3 * player.weapon.skin);
			this.the_player.animation.armor.gotoAndStop(player.armor.weight + 3 * player.armor.skin);
		
			player.move_frame = (player.move_frame + player.speed * 2) % 60;
		
			if (player.direction == LEFT) {
				this.the_player.scaleX = -1.25;
				this.the_player.hpBar_fr.scaleX = -1;
				this.the_player.hpBar_mini.scaleX = -1;
				this.the_player.sBar_fr.scaleX = -1;
				this.the_player.sBar.scaleX = -1;
				if (!battle) {
					this.the_player.gotoAndStop(0);
				}
				this.the_player.animation.gotoAndStop(Math.floor(player.move_frame));
				if ((player.posX - field_move) <= 6.75) {
					field_move += ((player.posX - field_move) - 6.75) / Math.max(1, (10 / player.speed));
				}
			} else if (player.direction == RIGHT) {
				this.the_player.scaleX = 1.25;
				this.the_player.hpBar_fr.scaleX = 1;
				this.the_player.hpBar_mini.scaleX = 1;
				this.the_player.sBar_fr.scaleX = 1;
				this.the_player.sBar.scaleX = 1;
				if (!battle) {
					this.the_player.gotoAndStop(0);
				}
				this.the_player.animation.gotoAndStop(Math.floor(player.move_frame));
				if ((player.posX - field_move) >= 3.25) {
					field_move += ((player.posX - field_move) - 3.25) / Math.max(1, (10 / player.speed));
				}
			} else {
				this.the_player.gotoAndStop(1);
				this.the_player.animation_1.weapon.type.gotoAndStop(player.weapon.weight + 3 * player.weapon.skin);
				this.the_player.animation_1.armor.gotoAndStop(player.armor.weight + 3 * player.armor.skin);
		
			}
			this.the_player.x = 50 + (player.posX - field_move) * 100;
		
			this.distance_.text = "距离: " + Math.round(Math.abs(player.posX) * 10) / 10 + " 米";
			if (player.posX >= 0) {
				this.direction_.text = "方向: 东";
			} else {
				this.direction_.text = "方向: 西";
			}
			this.en_lv_.text = "敌人等级: " + player.posXLv;
			checkBuffs(player);
		
		}
		
		
		this.addEventListener("tick", closestEn.bind(this));
		function closestEn() {
			//find closest enemy
			var minDif = 9999;
			var closest;
			for (var i = 0; i < enemies.length; ++i) {
				if (Math.abs(enemies[i].posX - player.posX) < minDif && !enemies[i].dead) {
					closest = enemies[i];
					minDif = Math.abs(enemies[i].posX - player.posX);
				}
			}
			closestEnemy = closest;
		
			if (closestEnemy.direction == player.direction || player.direction == STAY) {
				this.enemyUI.visible = false;
				miniUI(false, closestEnemy);
			} else {
				this.enemyUI.visible = true;
				this.enemyUI.pi_t.text = "PI: " + format(Decimal.round(closestEnemy.pIndex));
		
		
				this.enemyUI.name_.text = closestEnemy.name;
				this.enemyUI.hp_now.text = format(closestEnemy.hp) + " / " + format(closestEnemy.stats[MAXHP].value);
				this.enemyUI.mp_now.text = format(closestEnemy.mp) + " / " + format(closestEnemy.stats[MANA].value);
				this.enemyUI.lv.text = closestEnemy.level;
				this.enemyUI.class_.text = "E";
				this.enemyUI.icon.gotoAndStop(closestEnemy.eType + 50*closestEnemy.eClass);
		
				closestEnemy.hpPv = (closestEnemy.hp.times(0.1).plus(closestEnemy.hpPv)).div(1.1);
				this.enemyUI.hp.gotoAndStop(Math.min(Decimal.floor(closestEnemy.hp.div(closestEnemy.stats[MAXHP].value).times(100)).toNumber(), 99));
				this.enemyUI.hp_under.gotoAndStop(Math.min(Decimal.floor(closestEnemy.hpPv.div(closestEnemy.stats[MAXHP].value).times(100)).toNumber(), 99));
				this.enemyUI.mp.gotoAndStop(Math.min(Decimal.floor(closestEnemy.mp.div(closestEnemy.stats[MANA].value).times(100)).toNumber(), 99));
		
				miniUI(true, closestEnemy);
			}
		
		}
		
		
		
		
		function getDBuffs(dealer, target, dmg) {
		
			//get bleed
			
			var bleedChance = dealer.stats[BLEED].value;
			var bleedRand = nd(Math.random());
			
			if (bleedRand.lte(bleedChance)) {
				if (effectExists(target.effects, DEBUFF, E_BLEED)) {
					target.effects[effectExists(target.effects, DEBUFF, E_BLEED) - 1].value = ((target.effects[effectExists(target.effects, DEBUFF, E_BLEED) - 1].value.times(target.effects[effectExists(target.effects, DEBUFF, E_BLEED) - 1].amount)).plus(dmg.div(10)).div(target.effects[effectExists(target.effects, DEBUFF, E_BLEED) - 1].amount).plus(1));
					target.effects[effectExists(target.effects, DEBUFF, E_BLEED) - 1].dur = ((nd(4).times(target.effects[effectExists(target.effects, DEBUFF, E_BLEED) - 1].amount)).plus(target.effects[effectExists(target.effects, DEBUFF, E_BLEED) - 1].dur).div(target.effects[effectExists(target.effects, DEBUFF, E_BLEED) - 1].amount).plus(1));
					target.effects[effectExists(target.effects, DEBUFF, E_BLEED) - 1].amount = target.effects[effectExists(target.effects, DEBUFF, E_BLEED) - 1].amount.plus(1);
				}
				else {
					target.effects.push(new effect(DEBUFF, E_BLEED, nd(4), dmg.div(10)));
				}
			}
			
			//get rage
			
			var rageChance = dealer.stats[RGCH].value;
			var rageRand = nd(Math.random());
			
			if (rageRand.lte(rageChance)) {
				if (effectExists(dealer.effects, BUFF, E_RAGE)) {
					dealer.effects[effectExists(dealer.effects, BUFF, E_RAGE) - 1].value = dealer.effects[effectExists(dealer.effects, BUFF, E_RAGE) - 1].amount.times(dealer.stats[RGPOW].value);
					dealer.effects[effectExists(dealer.effects, BUFF, E_RAGE) - 1].dur = ((dealer.stats[RGDUR].value.times(dealer.effects[effectExists(dealer.effects, BUFF, E_RAGE) - 1].amount)).plus(dealer.effects[effectExists(dealer.effects, BUFF, E_RAGE) - 1].dur).div(dealer.effects[effectExists(dealer.effects, BUFF, E_RAGE) - 1].amount).plus(1));
					dealer.effects[effectExists(dealer.effects, BUFF, E_RAGE) - 1].amount = dealer.effects[effectExists(dealer.effects, BUFF, E_RAGE) - 1].amount.plus(1);
				}
				else {
					dealer.effects.push(new effect(BUFF, E_RAGE, dealer.stats[RGDUR].value, dealer.stats[RGPOW].value));
				}
			}
			
			
			
		}
		
		
		
		function getCrit(dealer) {
			var randNum;
			randNum = nd(Math.random());
			if (randNum.lte(dealer.stats[SCRIT].value)) {
				return nd(5);
			}
			else {
				randNum = nd(Math.random());
				if (randNum.lte(dealer.stats[MCRIT].value)) {
					return nd(3);
				}
				else {
					randNum = nd(Math.random());
					if (randNum.lte(dealer.stats[CRIT].value)) {
						return nd(2);
					}
					else {
						return nd(1);
					}
				}
			}
		}
		
		
		
		function critToS(mod) {
			if (mod.eq(nd(5))) {
				return "!!!";
			}
			else if (mod.eq(nd(3))) {
				return "!!";
			}
			else if (mod.eq(nd(2))) {
				return "!";
			}
			else return "";
		}
		
		
		
		function dealDamage(dealer, target) {
			var dmg = (dealer.stats[ATK].value.times(dealer.atMinPow)).plus(nd(Math.random()).times(dealer.stats[ATK].value).times(dealer.atMaxPow.sub(dealer.atMinPow)));
			dmg = dmg.times(dealer.dps.times(dealer.stats[ATK].value).div((dealer.dps.times(dealer.stats[ATK].value)).plus(target.baseDef.times(target.stats[DEF].value))));
			
			
			var hitChance = dealer.stats[PREC].value.div(dealer.stats[PREC].value.plus(target.stats[AVOID].value));
			
			var missR = nd(Math.random());
			
			
		
			var blockChance = target.stats[BLCH].value;
			
			var blR = nd(Math.random());
			
			
			var critMod = getCrit(dealer);
			dmg = dmg.times(critMod);
			
			
			if (missR.lte(hitChance)) {
				
				if (blR.gt(blockChance)) {
					
					target.hp = target.hp.sub(dmg);
					dealer.hp = dealer.hp.plus(dmg.times(dealer.stats[LFSTL].value));
					
					getDBuffs(dealer, target, dmg);
					
					if (target == closestEnemy) {
						makeSplash("-" + format(dmg) + critToS(critMod), closestEnemy.link, 1);
					}
					if (target == player) {
						makeSplash("-" + format(dmg) + critToS(critMod), this.exportRoot.the_player, -1);
					}
				}
				else {
					target.hp = target.hp.sub(dmg.times(nd(1).sub(target.stats[BLAM].value)));
					dealer.hp = dealer.hp.plus(dmg.times(nd(1).sub(target.stats[BLAM].value)).times(dealer.stats[LFSTL].value));
					
					getDBuffs(dealer, target, dmg.times(nd(1).sub(target.stats[BLAM].value)));
					
					if (target == closestEnemy) {
						makeSplash("-" + format(dmg.times(nd(1).sub(target.stats[BLAM].value))) + critToS(critMod) + "[B]", closestEnemy.link, 1);
					}
					if (target == player) {
						makeSplash("-" + format(dmg.times(nd(1).sub(target.stats[BLAM].value))) + critToS(critMod) + "[B]", this.exportRoot.the_player, -1);
					}
				}
			}
			else {
				if (target == closestEnemy) {
					makeSplash("miss", closestEnemy.link, 1);
				}
				if (target == player) {
					makeSplash("miss", this.exportRoot.the_player, -1);
				}
			}
			
			if (closestEnemy.hp.lte(0)) {
				player.xpNow = player.xpNow.plus(closestEnemy.xpAdd);
				for (var i = 0; i < closestEnemy.stats2steal.length; ++i) {
					player.stoleStats[closestEnemy.stats2steal[i].type] = player.stoleStats[closestEnemy.stats2steal[i].type].plus(closestEnemy.stats2steal[i].value);
				}
		
				closestEnemy.dead = true;
				
				//add bag
				var isBag = Math.random();
				if (isBag < 0.333) {
					makeBag(closestEnemy.level, closestEnemy.posX);
				}
				
				
				closestEnemy.respawn = 20;
				closestEnemy.effects.splice(0, closestEnemy.effects.length);
				fAtkCd = 0;
			}
		}
		
		
		
