		function makeBag(level, pos) {
			var bag = new lib.bag();
		
			
			var rarity = Math.random();
			if (rarity > 0.8) {
				bag.rarity = TRASH;
			}
			else if (rarity > 0.35) {
				bag.rarity = COMMON;
			}
			else if (rarity > 0.06) {
				bag.rarity = UNCOMMON;
			}
			else if (rarity > 0.015) {
				bag.rarity = RARE;
			}
			else if (rarity > 0.004) {
				bag.rarity = EPIC;
			}
			else if (rarity > 0.001) {
				bag.rarity = LEGENDARY;
			}
			else if (rarity > 0.0001) {
				bag.rarity = MYTHICAL;
			}
			else {
				bag.rarity = GODLY;
			}
			
			
			var weight = Math.random();
			if (weight > 0.666) {
				bag.weight = LIGHT;
			}
			else if (weight > 0.333) {
				bag.weight = MEDIUM;
			}
			else {
				bag.weight = HARD;
			}
			
			
			bag.pos = pos;
			bag.level = level;
			
			bag.skin = Math.floor(level/5);
			
			var wepOrArm = Math.random();
			if (wepOrArm < 0.5) {
				bag.type = 0; //armor
				bag.eq = new armor(bag.level, bag.rarity, bag.weight, bag.skin, 0);
			}
			else {
				bag.type = 1; //weapon
				bag.eq = new weapon(bag.level, bag.rarity, bag.weight, bag.skin, 0);
			}
			
			bag.alive = true;
			bag.gotoAndStop(1 - bag.type);
		
			stage.addChild(bag);
			
		
			bag.addEventListener('tick', bagSet);
		}
		
		
		
		function bagSet(e) {
			var bag = e.currentTarget;
			bag.gotoAndStop(1 - bag.type);
			bag.y = 299.5;
			bag.x = 50 + (bag.pos - field_move) * 100;
			
			if (Math.abs(bag.pos - player.posX) <= 0.25 && bag.alive) {
		
				pushItem(bag.eq, bag.type);
				bag.alive = false;
				stage.removeChild(bag);
				bag.removeEventListener('tick', bagSet);
			}
			
		}
		
		
		
		function checkBuffs(creature) {
		
		
			if (!creature.bleedTick) {
				creature.bleedTick = nd(0.01);
			}
			
			if (!creature.rSum) {
				creature.rSum = nd(0);
			}
			
			creature.bleedTick = creature.bleedTick.plus(nd(1/fps*timeMult));
			
			var wasBuff = false;
			
			for (var i = 0 ; i < creature.effects.length ; ++i) {
				if (creature.effects[i].bod == DEBUFF && creature.effects[i].type == E_BLEED && creature.bleedTick.gte(1)) {
					creature.bleedTick = nd(creature.bleedTick.toNumber()%1);
					
					var dmg = creature.effects[i].value.times(creature.effects[i].amount);
					
					creature.hp = creature.hp.sub(dmg);
					
					if (creature == player) {
						makeSplash("-" + format(dmg), this.exportRoot.the_player, -1);
					}
					else {
						makeSplash("-" + format(dmg), creature.link, 1);
					}
					
					if (creature.hp.lte(0) && creature != player) {
						player.xpNow = player.xpNow.plus(creature.xpAdd);
						for (var i = 0; i < creature.stats2steal.length; ++i) {
							player.stoleStats[creature.stats2steal[i].type] = player.stoleStats[creature.stats2steal[i].type].plus(creature.stats2steal[i].value);
						}
		
						creature.dead = true;
						creature.effects.splice(0, creature.effects.length);
						creature.respawn = 20;
						fAtkCd = 0;
						
						
						
					}
					
				}
				
				if (!wasBuff) {
					creature.rSum = nd(0);
				}
				
				if (creature.effects[i] && creature.effects[i].bod == BUFF && creature.effects[i].type == E_RAGE) {
					
					creature.rSum = creature.effects[i].value;
					wasBuff = true;
				}
				
				if (creature.effects[i]) {
					creature.effects[i].dur = creature.effects[i].dur.sub(nd(1/fps*timeMult));
				}
				if (creature.effects[i] && creature.effects[i].dur <= 0) {
					creature.effects.splice(i, 1);
				}
			}
			
			
		}
		
		
		
		
		this.addEventListener("tick", fighting.bind(this));
		function fighting() {
			if (fAtkCd > 0) {
				fAtkCd -= 1/fps*timeMult;
			}
			else {
				fAtkCd = 0;
			}
			
			if (Math.abs(closestEnemy.posX - player.posX) <= 1.5) {
				if (closestEnemy.direction * player.direction == -1) {
					if (!battle && fAtkCd <= 0) {
						fAtkCd = 2;
						dealDamage(player, closestEnemy);
					}
						
					battle = true;
				} else {
					battle = false;
				}
			} else {
				battle = false;
			}
		
		
		
			if (battle) {
				player.tick += 1 / fps * timeMult;
				closestEnemy.tick += 1 / fps * timeMult;
		
		
				var playerPC = player.tick / player.tickMax;
				var enemyPC = closestEnemy.tick / closestEnemy.tickMax;
		
		
				if (prevFr1 < 25 && Math.floor(playerPC * 119) >= 25 && !skill1) {
					dealDamage(player, closestEnemy);
				}
				else if (prevFr1 < 25 && Math.floor(playerPC * 119) >= 25 && skill1) {
					dealDamageSkill(player, closestEnemy, 0); //skill1 = 0
				}
		
				if (prevFr2 < 25 && Math.floor(enemyPC * 119) >= 25) {
					dealDamage(closestEnemy, player);
				}
		
		
				if (enemyPC <= 50 / 120) {
					closestEnemy.link.enty.gotoAndStop(2);
					closestEnemy.link.enty.enemy_anim_2.gotoAndStop(Math.floor(enemyPC * 119));
			
					
					closestEnemy.link.gotoAndStop(0);
					closestEnemy.link.enty.enemy_anim_2.the_enemy.gotoAndStop(closestEnemy.eType + 50*closestEnemy.eClass);
					closestEnemy.link.enty.enemy_anim_2.the_arm.gotoAndStop(closestEnemy.eType + 50*closestEnemy.eClass);
					
					stage.addChild(closestEnemy.link);
					prevFr2 = Math.floor(enemyPC * 119);
				} else if (enemyPC <= 100 / 120) {
					closestEnemy.link.enty.gotoAndStop(0);
			
					closestEnemy.link.gotoAndStop(0);
					closestEnemy.link.enty.enemy_anim_1.the_enemy.gotoAndStop(closestEnemy.eType + 50*closestEnemy.eClass);
					closestEnemy.link.enty.enemy_anim_1.the_arm.gotoAndStop(closestEnemy.eType + 50*closestEnemy.eClass);
					
					prevFr2 = Math.floor(enemyPC * 119);
				} else {
					closestEnemy.link.enty.gotoAndStop(1);
					closestEnemy.link.enty.enemy_anim_1.gotoAndStop(Math.floor(enemyPC * 119 - 100));
			
					closestEnemy.link.gotoAndStop(0);
					closestEnemy.link.enty.enemy_anim_1.the_enemy.gotoAndStop(closestEnemy.eType + 50*closestEnemy.eClass);
					closestEnemy.link.enty.enemy_anim_1.the_arm.gotoAndStop(closestEnemy.eType + 50*closestEnemy.eClass);
					
					prevFr2 = Math.floor(enemyPC * 119);
				}
		
		
		
				if (playerPC <= 50 / 120 && !skill1 && !skill2 && !skill3 && !skill4 && !skill5 && !skill6 && !skill7 && !skill8) {
					this.the_player.gotoAndStop(3);
					this.the_player.animation_3.weapon.type.gotoAndStop(player.weapon.weight + 3 * player.weapon.skin);
					this.the_player.animation_3.armor.gotoAndStop(player.armor.weight + 3 * player.armor.skin);
					this.the_player.animation_3.gotoAndStop(Math.floor(playerPC * 119));
					stage.addChild(this.the_player);
					prevFr1 = Math.floor(playerPC * 119);
				} 
				else if (playerPC <= 50 / 120 && skill1) {
					this.the_player.gotoAndStop(4);
					this.the_player.animation_4.weapon.type.gotoAndStop(player.weapon.weight + 3 * player.weapon.skin);
					this.the_player.animation_4.armor.gotoAndStop(player.armor.weight + 3 * player.armor.skin);
					this.the_player.animation_4.gotoAndStop(Math.floor(playerPC * 119));
					stage.addChild(this.the_player);
					prevFr1 = Math.floor(playerPC * 119);
				} 
				else if (playerPC <= 100 / 120) {
					this.the_player.gotoAndStop(1);
					this.the_player.animation_1.armor.gotoAndStop(player.armor.weight + 3 * player.armor.skin);
					this.the_player.animation_1.weapon.type.gotoAndStop(player.weapon.weight + 3 * player.weapon.skin);
					prevFr1 = Math.floor(playerPC * 119);
				} else {
					this.the_player.gotoAndStop(2);
					this.the_player.animation_2.armor.gotoAndStop(player.armor.weight + 3 * player.armor.skin);
					this.the_player.animation_2.weapon.type.gotoAndStop(player.weapon.weight + 3 * player.weapon.skin);
					this.the_player.animation_2.gotoAndStop(Math.floor(playerPC * 119 - 100));
		
					prevFr1 = Math.floor(playerPC * 119);
				}
		
		
				if (player.tick >= player.tickMax) {
					player.tick %= player.tickMax;
					prevFr1 = 0;
				}
		
				if (closestEnemy.tick >= closestEnemy.tickMax) {
					closestEnemy.tick %= closestEnemy.tickMax;
					prevFr2 = 0;
				}
		
		
		
			}
		
		
			if (closestEnemy.hp.gte(closestEnemy.stats[MAXHP].value)) {
				closestEnemy.hp = closestEnemy.stats[MAXHP].value;
			} else if (battle) {
				closestEnemy.hp = closestEnemy.hp.plus(closestEnemy.stats[HPRG].value.div(fps).times(timeMult));
			} else {
				closestEnemy.hp = closestEnemy.hp.plus(nd(50).times(closestEnemy.stats[HPRG].value).div(fps).times(timeMult));
			}
		
			if (closestEnemy.mp.gte(closestEnemy.stats[MANA].value)) {
				closestEnemy.mp = closestEnemy.stats[MANA].value;
			} else {
				closestEnemy.mp = closestEnemy.mp.plus(closestEnemy.stats[MPRG].value.div(fps).times(timeMult));
			}
		
		
		
		}
		
		
		
		
		function makeSplash(text, posObj, enORpl) {
			var spl = new lib.splash();
			spl.dm.text = text;
			spl.x = posObj.x;
			spl.y = posObj.y - 50;
			spl.dir = enORpl;
		
			stage.addChild(spl);
		
			spl.addEventListener('tick', splSet);
		
		}
		
		
		
		
		function splSet(e) {
			var splash = e.currentTarget;
			splash.x += (1 + Math.random() * 4) * splash.dir;;
			splash.y -= 3 + Math.random() * 5;
			splash.alpha -= 1 / 3 / fps * timeMult;
			if (splash.alpha <= 0) {
				splash.removeEventListener('tick', splSet);
				stage.removeChild(splash);
			}
		
		}
		
		
		
