		this.addEventListener("tick", loopPlayer.bind(this));
		function loopPlayer() {
			if (player.direction == LEFT) {
				this.setLeft.gotoAndStop(1);
				this.whereMoving.text = "左移";
			} else this.setLeft.gotoAndStop(0);
		
			if (player.direction == STAY) {
				this.setStop.gotoAndStop(1);
				this.whereMoving.text = "休息 (x10 生命值回复)";
			} else this.setStop.gotoAndStop(0);
		
			if (player.direction == RIGHT) {
				this.setRight.gotoAndStop(1);
				this.whereMoving.text = "右移";
			} else this.setRight.gotoAndStop(0);
		
			if (player.loop == true) {
				this.setLoop.gotoAndStop(1);
				this.loopIs.text = "循环: 是";
				this.loopDist.visible = true;
				this.loopDist.text = "循环距离: " + Math.round(player.loopD) + " 米";
			} else {
				this.setLoop.gotoAndStop(0);
				this.loopIs.text = "循环: 否";
				this.loopDist.visible = false;
			}
		
		
			if (player.loop == true) {
				if (player.posX <= player.loopLeft) {
					player.direction = RIGHT;
				} else if (player.posX >= player.loopRight) {
					player.direction = LEFT;
				}
			}
		
		}
		
		
		
		
		this.addEventListener("tick", main_stats.bind(this));
		function main_stats() {
			if (Math.abs(player.posX) > maxDistance) {
				maxDistance = Math.abs(player.posX);
				maxDLevel = player.posXLv;
			}
		
			player.posXLv = Math.ceil(Math.abs(player.posX) / 30);
		
			for (var t = 0 ; t < player.eqStats.length ; ++t) {
				player.eqStats[t] = nd(0);
			}
			
			
			for (var i = 0; i < player.weapon.dop_stats ; ++i) {
				player.eqStats[player.weapon.dopst[i]] = player.eqStats[player.weapon.dopst[i]].plus(player.weapon.dops[i]);
			}
			
			for (var i = 0; i < player.armor.dop_stats ; ++i) {
				player.eqStats[player.armor.dopst[i]] = player.eqStats[player.armor.dopst[i]].plus(player.armor.dops[i]);
			}
			
			
			
			for (var i = 0; i < 8; ++i) {
				player.stats[i].avaible = true;
				player.stats[i].value = player.baseStats[i].plus(player.stoleStats[i]).plus(player.eqStats[i]);
			}
			player.baseStats[MAXHP] = Decimal.floor(Decimal.pow(nd(player.level + 10), 1.27).times(Decimal.pow(player.stats[VIT].value, 1.17)).times(Decimal.pow(nd(1.01), Math.pow(player.stats[VIT].value, 0.75))).times(4)).div(10);
			player.baseStats[MAXHP] = player.baseStats[MAXHP].times(nd(1 + (player.level ** 3)/1000 + (0.2 * player.level)));
			player.baseStats[MAXHP] = player.baseStats[MAXHP].times(nd(2 ** (player.level/50)));
			player.baseStats[ATK] = Decimal.floor(Decimal.pow(nd(player.level + 10), 1.24).times(Decimal.pow(player.stats[STR].value, 1.19)).times(Decimal.pow(nd(1.01), Math.pow(player.stats[STR].value, 0.75))).div(1.2)).div(100);
			player.baseStats[DEF] = Decimal.floor(Decimal.pow(nd(player.level + 10), 1.19).times(Decimal.pow(player.stats[ARM].value, 1.25)).times(nd(1).plus(Decimal.pow(player.stats[VIT].value, 0.35).times(0.03))).times(Decimal.pow(nd(1.01), Decimal.pow(player.stats[ARM].value, 0.77))).div(2)).div(100);
			player.baseStats[ASPD] = 1.75 * Math.pow(0.99, Math.pow(player.stats[AGI].value, 0.84));
			player.baseStats[MANA] = Decimal.round(nd(100).plus(Decimal.pow(nd(player.level), 0.5)).plus(Decimal.pow(player.stats[INT].value, 0.9)));
			if (player.stats[ELEM].value != NONE) {
				player.baseStats[MATK] = Decimal.floor(Decimal.pow(nd(player.level + 10), 1.12).times(Math.pow(player.stats[INT].value, 1.14)).times(Decimal.pow(nd(1.01), Decimal.pow(player.stats[INT].value, 0.76))).div(20)).div(10);
			} else {
				player.baseStats[MATK] = nd(0);
			}
			player.baseStats[HPRG] = player.stats[MAXHP].value.div(250);
			player.baseStats[MPRG] = player.stats[MANA].value.div(100);
			player.baseStats[MCON] = nd(1);
			player.baseStats[AVOID] = nd(0);
			player.baseStats[PREC] = nd(player.stats[AGI].value);
		
			
		
			for (var i = 8; i < 11; ++i) {
				player.stats[i].value = player.baseStats[i].plus(player.stoleStats[i]).plus(player.eqStats[i]);
			}
			
			player.stats[ASPD].value = player.baseStats[ASPD] / ((player.stoleStats[ASPD].plus(1).toNumber()) * (player.eqStats[ASPD].plus(1).toNumber()));
			player.stats[ASPD].value = player.stats[ASPD].value * player.weapon.aspBase.toNumber();
		
			
			for (var i = 12; i < 14; ++i) {
				player.stats[i].value = player.baseStats[i].plus(player.stoleStats[i]).plus(player.eqStats[i]);
			}
		
			for (var i = 15; i < 17; ++i) {
				player.stats[i].value = player.baseStats[i].plus(player.stoleStats[i]).plus(player.eqStats[i]);
			}
		
		
			player.baseStats[MCON] = Decimal.pow(nd(0.999), Decimal.pow(player.stats[INT].value, 0.75));
			player.stats[MCON].value = player.baseStats[MCON].div(player.stoleStats[MCON].plus(1)).div(player.eqStats[MCON].plus(1));
		
			player.stats[PREC].value = player.baseStats[PREC].plus(player.stoleStats[PREC]).plus(player.eqStats[PREC]);
			player.stats[AVOID].value = player.baseStats[AVOID].plus(player.stoleStats[AVOID]).plus(player.eqStats[AVOID]);
		
			for (var i = 0; i < 20; ++i) {
				player.stats[i].avaible = true;
			}
		
			for (var i = 20; i < 59; ++i) {
				player.stats[i].value = player.baseStats[i].plus(player.stoleStats[i]).plus(player.eqStats[i]);
				if (player.stats[i].value <= 0) {
					player.stats[i].avaible = false;
				} else {
					player.stats[i].avaible = true;
				}
			}
		
			player.stats[HPRG].value = player.stats[HPRG].value.times(nd(1 - Math.abs(player.direction)).times(9).plus(1));
		
			player.speed = (0.9775 + Math.pow(player.stats[AGI].value.toNumber() / 2, 0.5) / 100) * player.armor.baseSpeed;
		
			player.xpNext = (nd(4).plus(player.level)).times(2).times(Decimal.pow(nd(1.1), (player.level - 1))).sub(5);
		
			player.baseDef = player.armor.defMult;
		
			player.stats[ATK].value = player.stats[ATK].value.times((nd(1).plus(player.rSum)));
			player.stats[ASPD].value /= ((player.rSum).plus(1).toNumber());
			
			player.tickMax = player.stats[ASPD].value;
			
			
			if (invType == 0) {
				this.eqBtn.gotoAndStop(0);
				this.absBtn.gotoAndStop(1);
			}
			else {
				this.eqBtn.gotoAndStop(1);
				this.absBtn.gotoAndStop(0);
			}
			
			
			
		}
		
		
