		this.addEventListener("tick", main_gameplay.bind(this));
		function main_gameplay() {
			if (player.hp.gte(player.stats[MAXHP].value)) {
				player.hp = player.stats[MAXHP].value;
			} else if (player.hp.gte(0)) {
				player.hp = player.hp.plus(player.stats[HPRG].value.div(fps).times(timeMult));
			}
		
			if (player.mp.gte(player.stats[MANA].value)) {
				player.mp = player.stats[MANA].value;
			} else {
				player.mp = player.mp.plus(player.stats[MPRG].value.div(fps).times(timeMult));
			}
		
		
			if (player.xpNow.gte(player.xpNext)) {
				player.level++;
				player.statPts += 1;
				player.xpNow = player.xpNow.sub(player.xpNext);
			}
		
		
		
		}
		
