		function eqOrAbs(curCell) {
			if (player.level >= inventory[curCell].eq.level && invType == 0) {
				if (inventory[curCell].isWeapon) {
					var temp = player.weapon;
					player.weapon = inventory[curCell].eq;
					inventory[curCell].eq = temp;
				}
				else {
					var temp = player.armor;
					player.armor = inventory[curCell].eq;
					inventory[curCell].eq = temp;
				}
			}
			else if (invType == 1) {
				for (var i = 0 ; i < inventory[curCell].eq.dop_stats ; ++i) {
					player.stoleStats[inventory[curCell].eq.dopst[i]] = player.stoleStats[inventory[curCell].eq.dopst[i]].plus(inventory[curCell].eq.dops[i].times(0.2));
				}
				inventory[curCell].eq = NULLITEM;
				inventory[curCell].isNULL = true;
			}
		}
		
		
