		function setShowEq(cell, num) {
			if (inventory[num].isNULL) {
				cell.gotoAndStop(0);
				cell.item.visible = false;
				cell.item_1.visible = false;
				cell.rarity.visible = false;
			}
			else if (inventory[num].isWeapon) {
				cell.gotoAndStop(0);
				cell.item.visible = true;
				cell.item_1.visible = true;
				cell.rarity.visible = true;
				cell.rarity.gotoAndStop(inventory[num].eq.rarity);
				cell.item.gotoAndStop(inventory[num].eq.skin*3 + inventory[num].eq.weight);
			}
			else {
				cell.gotoAndStop(1);
				cell.item.visible = true;
				cell.item_1.visible = true;
				cell.rarity.visible = true;
				cell.rarity.gotoAndStop(inventory[num].eq.rarity);
				cell.item_1.gotoAndStop(inventory[num].eq.skin*3 + inventory[num].eq.weight);
			}
		}
		
		
		function pushItem(item, type) { //type 0-armor, 1-weapon
			var i = 0;
			while (i < 45 && !inventory[i].isNULL) {
				++i;
			}
			if (i < 45) {
				inventory[i].eq = item;
				inventory[i].isNULL = false;
				if (type) {
					inventory[i].isWeapon = true;
				}
				else {
					inventory[i].isWeapon = false;
				}
			}
		}
		
		
