		function tutMain() {
			if (isTutor) {
				this.tutorial.visible = true;
				stage.addChild(this.tutorial);
			}
			else {
				this.tutorial.visible = false;
			}
			
			
			if (eTypes == 0) {
				this.eType.text = "混合敌人";
			}
			else if (eTypes == 1) {
				this.eType.text = "仅史莱姆";
			}
			else if (eTypes == 2) {
				this.eType.text = "仅动物";
			}
			else if (eTypes == 3) {
				this.eType.text = "仅人型";
			}
			
			
		}
		
		
		this.etLeft.addEventListener("click", goETLeft.bind(this));
		function goETLeft() {
			if (eTypes == 0) {
				eTypes = 2;
			}
			else {
				eTypes -= 1;
			}
			removeEnemies();
		}
		
		
		this.etRight.addEventListener("click", goETRight.bind(this));
		function goETRight() {
			if (eTypes == 2) {
				eTypes = 0;
			}
			else {
				eTypes += 1;
			}
			removeEnemies();
		}
		
		
		function short(num) {
			if (num < 10) {
				return Math.round(num * 100) / 100;
			} else if (num < 100) {
				return Math.round(num * 10) / 10;
			} else if (num < 1000) {
				return Math.round(num);
			} else if (num < 10000) {
				return Math.round(num / 10) / 100 + "K";
			} else if (num < 100000) {
				return Math.round(num / 100) / 10 + "K";
			} else if (num < 1000000) {
				return Math.round(num / 1000) + "K";
			} else if (num < 10000000) {
				return Math.round(num / 10000) / 100 + "M";
			} else if (num < 100000000) {
				return Math.round(num / 100000) / 10 + "M";
			} else {
				return Math.round(num / 1000000) + "M";
			}
		}
		
		
		
		
		this.addEventListener("tick", main_fs.bind(this));
		function main_fs() {
			if (fullscreen) {
				this.f_screen.gotoAndStop(1);
			} else this.f_screen.gotoAndStop(0);
			var isFullscreen = document.webkitIsFullScreen || document.mozFullScreen || false;
			isFullscreen ? fullscreen = true : fullscreen = false;
		
			mousePosX = stage.mouseX / canvas.width * 1100;
			mousePosY = stage.mouseY / canvas.height * 768;
		
		}
		
		
		this.f_screen.addEventListener("click", Fscr.bind(this));
		function Fscr() {
			if (!fullscreen) {
				fullscreen = true;
				toggleFullscreen();
			} else {
				fullscreen = false;
				toggleFullscreen();
			}
		}
		
		
		function toggleFullscreen(event) {
			var element = document.body;
		
			if (event instanceof HTMLElement) {
				element = event;
			}
		
			var isFullscreen = document.webkitIsFullScreen || document.mozFullScreen || false;
		
			element.requestFullScreen = element.requestFullScreen || element.webkitRequestFullScreen || element.mozRequestFullScreen || function () {
				return false;
			};
			document.cancelFullScreen = document.cancelFullScreen || document.webkitCancelFullScreen || document.mozCancelFullScreen || function () {
				return false;
			};
		
			isFullscreen ? document.cancelFullScreen() : element.requestFullScreen();
		}
