		function devSet() {
			
			
			if (this.helpSplash.alpha > 0) {
				this.helpSplash.alpha -= 1/12/fps*timeMult;
			}
			else if (this.helpSplash.alpha < 0) {
				this.helpSplash.alpha = 0;
			}
			
			if (respawn > 0) {
				this.adButton.visible = false;
				respawn -= 1/fps*timeMult;
			}
			else {
				this.adButton.visible = true;
			}
			d = new Date();
			time1_ib = d.getTime()/1000;
			
		}
		
		
		function adStarted() {
			fps = 100000000;
			fps2 = 100000000;
		
		}
		
		function adError() {
		    fps = 30;
			fps2 = 30;
			this.helpSplash.alpha = 1;
			this.helpSplash.text = "这是一个广告错误，但无论如何这里有 1.5 分钟的奖励时间给你 ;)";
			speedUPtime_ib += 90;
			respawn = 300;
		}
		
		function adFinished() {
		    fps = 30;
			fps2 = 30;
			this.helpSplash.alpha = 1;
			this.helpSplash.text = "非常感谢观看。 这是您的奖金 5 分钟！";
			speedUPtime_ib += 300;
			respawn = 300;
		}
		
		function adError2() {
		    fps = 30;
			fps2 = 30;
			
		}
		
		
		function adFinished2() {
		    fps = 30;
			fps2 = 30;
			
			var type = Math.random();
			var rarity = Math.random();
			var weight = Math.random();
			
			
			if (rarity > 0.8) {
				rarity = RARE;
			}
			else if (rarity > 0.15) {
				rarity = EPIC
			}
			else {
				rarity = LEGENDARY;
			}
		
			if (weight > 0.666) {
				weight = HARD;
			}
			else if (weight > 0.333) {
				weight = MEDIUM;
			}
			else {
				weight = LIGHT;
			}
		
			if (type < 0.5) {
				type = 0;
				pushItem(new armor(player.level, rarity, weight, Math.floor(player.level / 5), 0), 0);
			}
			else {
				type = 1;
				pushItem(new weapon(player.level, rarity, weight, Math.floor(player.level / 5), 0), 1);
			}
			
			this.helpSplash.text = "你得到了很酷的装备";
		}
		
		
